backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1534522","type":"CustomJS"},{"attributes":{"coordinates":null,"group":null},"id":"1534553","type":"Title"},{"attributes":{},"id":"1534486","type":"BasicTickFormatter"},{"attributes":{"source":{"id":"1534203"}},"id":"1534446","type":"CDSView"},{"attributes":{"source":{"id":"1534260"}},"id":"1534265","type":"CDSView"},{"attributes":{"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"1534251","type":"Line"},{"attributes":{},"id":"1534363","type":"LinearScale"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1534234","type":"BoxAnnotation"},{"attributes":{},"id":"1534430","type":"SaveTool"},{"attributes":{"active_drag":{"id":"1534373"},"active_scroll":{"id":"1534374"},"tools":[{"id":"1534373"},{"id":"1534374"},{"id":"1534375"},{"id":"1534376"},{"id":"1534377"},{"id":"1534378"},{"id":"15
